import { format, toPx } from "@microsoft/fast-jss-utilities";
import { applyElevatedCornerRadius } from "../utilities/border";
import { designUnit, outlineWidth } from "../utilities/design-system";
import { applyElevation, ElevationMultiplier } from "../utilities/elevation";
import { HighContrastColor, highContrastOptOutProperty, highContrastSelector, } from "../utilities/high-contrast";
import { neutralLayerFloating } from "../utilities/color";
const styles = {
    contextMenu: Object.assign({ background: neutralLayerFloating }, applyElevatedCornerRadius(), applyElevation(ElevationMultiplier.e11), { margin: "0", padding: format("{0} 0", toPx(designUnit)), "max-width": "368px", "min-width": "64px", transition: "all 0.2s ease-in-out", [highContrastSelector]: Object.assign({}, highContrastOptOutProperty, { background: HighContrastColor.buttonBackground, border: format("{0} solid {1}", toPx(outlineWidth), () => HighContrastColor.buttonText) }) }),
};
export default styles;
